var canvas, stage, exportRoot, images;

function init() {
	canvas = document.getElementById("canvas");
	resize();
	images = {};

	var manifest = [
		{src:"http://jsrun.it/assets/I/3/m/v/I3mv4.png", id:"producticonslarge"},
		{src:"http://jsrun.it/assets/o/I/X/j/oIXjW.png", id:"_4930248609_ebd510ecc6"}
	];

	var loader = new PreloadJS(false);
	loader.onFileLoad = handleFileLoad;
	loader.onComplete = handleComplete;
	loader.loadManifest(manifest);
}
function resize(){
	var obj=document.getElementById("wrapper");
	canvas.width=obj.clientWidth;
	canvas.height=obj.clientHeight;
	
	if(stage!=null && stage.onResize!=null){stage.onResize();}
}

function handleFileLoad(o) {
	if (o.type == "image") { images[o.id] = o.result; }
}

function handleComplete() {
	exportRoot = new lib.test1();

	stage = new Stage(canvas);
	stage.addChild(exportRoot);
	stage.update();

	Ticker.setFPS(30);
	Ticker.addListener(stage);
}
if (!window.lib) { window.lib = {}; }

