		(stage.onResize=function(){
			stage.scaleX=stage.scaleY=canvas.height/480
			
			var W=480
			var H=320
			
			var sw = canvas.width;
			var sh = canvas.height;
			
			var ws = sw / W;
			var hs = sh / H;
			
			if (ws < hs) {
				hs = ws;
				stage.y=(sh - H * hs) / 2;
			}else {
				ws = hs;
				stage.x = (sw - W * ws) / 2;
			}
			stage.scaleX = ws;
			stage.scaleY = hs;
		})();
		
