(lib.bg = function() {
	this.initialize();

	// timeline function:
	this.frame_0 = function() {
		
		var i,ele,bef,gnc;
		var num=1;
		var max=10;
		var step=0.6;//縮小率
		var speed=1.08
		var tv=1/step;
		var r=Math.PI/6;
		var flag=false
		
		var pts=[new Point(0,-250),
			new Point(95.65,-230.95),
			new Point(176.8,-176.8),
			new Point(230.95,-95.65),
			new Point(250,0),
			new Point(230.95,95.65),
			new Point(176.8,176.8),
			new Point(95.65,230.95),
			new Point(0,250),
			new Point(-95.65,230.95),
			new Point(-176.8,176.8),
			new Point(-230.95,95.65),
			new Point(-250,0),
			new Point(-230.95,-95.65),
			new Point(-176.8,-176.8),
			new Point(-95.65,-230.95)]
		
		for(i=0;i<max;i++){
			ele=new lib.element2();
			ele.g=new Graphics();
			ele.addChild(new Shape(ele.g))
			ele.visible=false;
			this.addChild(ele)
			
			ele.scaleY=Math.pow(step,max-i-1);
			ele.scaleX=ele.scaleY*1.3;
		}
		
		console.log(ele)
		
		this.onTick=function(){
			gnc=this.getNumChildren();
			for(i=1;i<gnc;i++){
				ele=this.getChildAt(i)
				ele.scaleY*=speed;
				ele.scaleX=ele.scaleY*1.3;
		//		if(ele.scaleY<=0){
		//			ele.color.alpha=1;
		//		}else if(ele.scaleY>=0.3){
		//			ele.color.alpha=0;
		//		}else{
		//			ele.color.alpha=(1-(ele.scaleY-0)/0.3)/2
		//		}
				ele.x+=ele.x/-70;
				ele.y+=ele.y/-70;
				
				if(i>1 && ele.visible){
					ele.g.clear()
					ele.g.beginStroke("#BCBB97");
					ele.g.setStrokeStyle(ele.scaleY)
					var p=bef.scaleY/ele.scaleY;
					var sx=(bef.x-ele.x)/ele.scaleY;
					var sy=(bef.y-ele.y)/ele.scaleY;
					for(var n=0;n<16;n++){
						ele.g.moveTo(pts[n].x,pts[n].y)
						ele.g.lineTo(pts[n].x*p+sx,pts[n].y*p+sy)
					}
					ele.g.endStroke();
				}
				bef=ele;
			}
			r-=0.01;
			if(r<=Math.PI*-1){
				r+=Math.PI*2
			}
			if(ele.scaleY>1.6){
				var top=this.getChildAt(1);
				this.addChildAt(ele,1);
				ele.scaleY=top.scaleY*step;
				ele.scaleX=ele.scaleY*1.3;
				ele.x=100*Math.cos(r)
				ele.y=80*Math.sin(r)
				if(!ele.visible && flag){
					ele.visible=true;
				}
			}
		}
		flag=true
	}

	// element
	this.shape = new Shape();
	this.shape.graphics.f("#edebe0").p("EglfgY/MAAAAx/MBK/AAAMAAAgx/MhK/AAA").f();

	this.addChild(this.shape);
	this.frame_0();
}).prototype = p = new Container();
